import React from "react";
import "./navbar.css";
// import icons from "./download/menu.svg";

class Navbar extends React.Component {
    constructor() {
        super();
        this.state={
            isMenu : false,
        }
    }
    render() {
        return (
            <div className="Navbar_wapp">
                <div className="logo"><h2><a href="#home">Sivaramakrishnan</a></h2></div>
                <nav className={`navbar_mobile ${this.state.isMenu ? "isMenu_on" : "isMenu_off"}`}>
                    <ul>
                        <li><a href="#home"><i style={{color:"whitesmoke"}} class="fas fa-home"></i>Home</a></li>
                        {/* <li><a href="#about">About</a></li> */}
                        <li><a href="#skills"><i style={{color:"whitesmoke"}} class="fas fa-graduation-cap"></i>Skills</a></li>
                        <li><a href="#work"><i class='fas fa-desktop'></i>Work</a></li>
                        <li><a href="#contact">Contact</a></li>
                        <li className="login">
                            <a href="#login">Login</a>
                        </li>
                    </ul>
                </nav>
                <div className="menu" onClick={()=>{this.setState({isMenu:!this.state.isMenu})}} >
                    <i class="fas fa-bars"></i>
                </div>
            </div>
        );
    }
}

export default Navbar;
